import React, {Component} from 'react';
import { connect } from 'react-redux';

class ShowingTodos extends Component {

    createTodosList() {
        return this.props.todosCollections.map((todosCollection) => {
            return(
                <li key={todosCollection.id}>
                    <h4>{todosCollection.id} || {todosCollection.text}</h4>
                </li>
            );
        });
    }


render(){
    return(
        <ul>
            {this.createTodosList()}
        </ul>
    );
  }
}

function mapStatetoProps(state) {
    return {
        todosCollections: state.todosCollections
    };
}

export default connect(mapStatetoProps) (ShowingTodos);
